function ProductList (props) 
{

    return (


        <ul className="list-group shadow">
        <div className='row'>
          <div className='col-lg-8 mx-auto'>
          {  props.newproduct.map((product) => {
                return ( <Products id = {product.pID} name ={product.pName}  desc={product.desc} isAvailable={ product.isAvailable} price={product.price}/>);
            })
        }
           </div>
        </div>
         </ul>
    );
}
export default ProductList;
